import React from 'react'

const Printer = (j) => {

  return (
    <div>
      {
        j.map((element, i) => {


          

          return <p>{i + 1}{". "}{element.joke}{"\n"}</p>
        }

        )
      }

    </div>
  )

}

export default Printer;
